import axios from "axios";
import React from "react";
import api from "./api/posts";

export default class SetSelect extends React.Component {
  state = {
    setNames: []
  }

  componentDidMount() {
    axios.get(`https://api.scryfall.com/sets/`)
      .then(res => {
        const sets = res.data;
        this.setState({ sets });
      })
  }

  render() {
    return (
      <ul>
        {
          this.state.sets
            .map(sets =>
              <li key={sets.id}>{sets.name}</li>
            )
        }
      </ul>
    )
  }
}
